import React from "react";
import "../styles/SkillShell.css";
import Skill from "../assets/skill.png";
import Superhero from "../assets/superhero.png";
import Discover from "../assets/discover.png";
import Community from "../assets/community.png";

function SkillShellPage() {
  return (
    <div>
    <div className="whiteLandingContainer">
      <h2>Skill Shell</h2>
      <div className="imgContainer">
        <img className="img"> <Discover /> </img>
        <img className="img"> <Skill /> </img>
        <img className="img"> <Community /> </img>
        <img className="img"> <Superhero /> </img>
      </div>
    </div>
    </div>
  );
}

export default SkillShellPage;
